  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's Undersea Research Center, the Hawaii
  Undersea Research Laboratory, explores and studies the waters around the Main Hawaiian
  Islands, Northwest Hawaiian Islands (NWHI), and U.S. flag Pacific Islands. It operates
  two deep diving (6562 ft) submersibles, Pisces IV and V; a 225-ft support vessel,
  R/V Ka'imikai-o-Kanaloa; a remotely operated vehicle, RCV-150; a multi-beam mapping
  system; and the largest annotated video archive (~7,000 hrs) in the Pacific. Research
  focus is on extreme ecosystems, coral habitats, volcanic systems and fisheries.\",\n\t\"owner_org\":
